let imagenFC =
  'data:image/png;base64,';
let imagenSunat =
  'data:image/png;base64,';

$('.tablaDataUsuario').DataTable({
  dom: 'B<"float-left"i><"float-right"f>t<"float-left"l><"float-right"p><"clearfix">',
  buttons: [
    {
      extend: 'excelHtml5',
      download: 'open',
      text: '<i class="fas fa-file-excel"> Excel</i> ',
      titleAttr: 'Exportar a Excel',
      className: 'btn btn-success',
      exportOptions: {
        columns: ':not(.no-exportar)', //exportar toda columna que no tenga la clase no-exportar
      },
    },
    {
      extend: 'pdf',
      download: 'open',
      orientation: 'landscape',
      text: '<i class="fas fa-file-pdf"> PDF</i> ',
      title: 'Reporte de Usuarios',
      titleAttr: 'Exportar a PDF',
      alignment: 'center',
      className: 'btn btn-danger',
      customize: function (doc) {
        doc.content[1].table.widths = ['7%', '20%', '38%', '35%'];
        doc.watermark = {
          text: 'FC Contadores & Asociados',
          bold: true,
          color: 'gray',
          opacity: 0.2,
        };
        doc.styles.title = {
          color: '#000000',
          fontSize: '25',
          bold: true,
          alignment: 'center',
        };
        doc.styles.tableHeader = {
          alignment: 'center',
          fontSize: '12',
          bold: true,
          color: '#FFFFFF',
          fillColor: '#000000',
        };
        doc.content[1].layout = {
          hLineWidth: function (i, node) {
            return i === 0 || i === node.table.body.length ? 1 : 1;
          },
          vLineWidth: function (i, node) {
            return i === 0 || i === node.table.widths.length ? 1 : 1;
          },
          hLineColor: function (i, node) {
            return i === 0 || i === node.table.body.length ? '#FFF' : '#FFF';
          },
          vLineColor: function (i, node) {
            return i === 0 || i === node.table.widths.length ? '#FFF' : '#FFF';
          },
        };
        doc['footer'] = function (page, pages) {
          let fechaHoy = new Date();
          return {
            columns: [
              `Fecha de Creacion: ${fechaHoy.toLocaleString()} - Generado por ${$(
                '#username'
              ).text()} ${fechaHoy.getFullYear()}`,
              {
                // This is the right column
                alignment: 'right',
                text: [
                  'pagina ',
                  { text: page.toString() },
                  ' de ',
                  { text: pages.toString() },
                ],
              },
            ],
            margin: [40, 0, 40, 0],
          };
        };
        doc.styles.tableBodyOdd.alignment = 'center';
        doc.styles.tableBodyEven.alignment = 'center';
        doc.styles.tableBodyOdd.fillColor = '#e9e9e9';
        doc.styles.tableBodyEven.fillColor = '#e9e9e9';
        doc.styles.tableBodyOdd.noWrap = true;
        doc.styles.tableBodyEven.noWrap = true;
        doc.styles.tableBodyOdd.fontSize = '10';
        doc.styles.tableBodyEven.fontSize = '10';
        doc.content.splice(0, 0, {
          columns: [
            {
              image: imagenFC,
              width: 150,
              opacity: 0.9,
            },
          ],
        });
      },
      exportOptions: {
        columns: ':not(.no-exportar)', //exportar toda columna que no tenga la clase no-exportar
      },
    },
    {
      extend: 'csv',
      text: '<i class="fa fa-print"> CSV</i> ',
      titleAttr: 'Exportar a CSV',
      className: 'btn btn-info',
      exportOptions: {
        columns: ':not(.no-exportar)', //exportar toda columna que no tenga la clase no-exportar
      },
    },
  ],
  autoWidth: false,
  language: language,
});

